  //     }
  //   }

  //   return answerString
  // }

  const createAllQuestions = () => {
    let answerString = ''
    for (let i = 0; i < questions.questions.length; i++) {
      if (i == questions.questions.length - 1) {
        answerString += questions.questions[i].question
      } else {
        answerString += questions.questions[i].question + ', '
      }
    }

    return answerString
  }

  console.log(questions.questions)

  return (
    <div className='completed-container'>
        <h1>You've Completed the Test!</h1>
        <h2>You Guessed {props.points} Questions <br /> of the 30 Correctly!</h2>

        <a className='restart-button' onClick={() => {
          props.setPoints(0)
          
        }} href='/'><VscDebugRestart /></a>

        <div className='tooltip2'><MicroModal trigger={(open) => <div onClick={open}><AiFillQuestionCircle /></div>}>{(close) => <div className='modal-container'>{questions.questions.map((element, index) => <p>{questions.questions[i].question}</p>)} <button onClick={close}>close</button></div>}</MicroModal>
          <span className='tooltiptext'>^</span>
          <span className='tooltiptext' id='test'>*Wrong Questions*</span>
          {/* <span className='tooltiptext' id='wrong-questions'>{createWrongQuestions()} </span> */}


      

          

        </div>
    </div>
  )
}

export default CompletedPage
